import React from 'react';

class Login extends React.Component {
  render() {
    return (
      <main>
        <section>
          <input type="email" data-testid="email-input" />
          <input type="password" data-testid="password-input" />
          <button type="submit" text="Entrar" />
        </section>
      </main>
    );
  }
}

export default Login;
